import { useEffect, useRef } from 'react';

interface WebSocketServiceProps {
  onMessage?: (message: any) => void;
  onOpen?: () => void;
  onClose?: (event: CloseEvent) => void;
  onError?: (error: Event) => void;
}

class WebSocketService {
  private ws: WebSocket | null = null;
  private reconnectAttempts = 0;
  private maxReconnectAttempts = 5;
  private reconnectInterval = 3000;
  private listeners: Map<string, Set<(data: any) => void>> = new Map();

  connect(userId?: number) {
    // 构建WebSocket连接URL
    const protocol = window.location.protocol === 'https:' ? 'wss:' : 'ws:';
    const host = window.location.host; // 使用当前主机名
    const wsUrl = `${protocol}//${host}/ws`;

    console.log('Attempting to connect to WebSocket:', wsUrl);

    try {
      this.ws = new WebSocket(wsUrl);

      this.ws.onopen = (event) => {
        console.log('WebSocket connected');
        this.reconnectAttempts = 0; // 重置重连计数

        // 发送用户ID（如果可用）
        if (userId) {
          this.send(JSON.stringify({ type: 'register', userId }));
        }
      };

      this.ws.onmessage = (event) => {
        try {
          const data = JSON.parse(event.data);
          this.notifyListeners(data.type, data);

          // 触发通用消息监听器
          if (this.listeners.has('message')) {
            this.listeners.get('message')?.forEach(callback => callback(data));
          }
        } catch (error) {
          console.error('Error parsing WebSocket message:', error);
          // 如果不是JSON格式，则触发通用消息监听器
          if (this.listeners.has('message')) {
            this.listeners.get('message')?.forEach(callback => callback(event.data));
          }
        }
      };

      this.ws.onclose = (event) => {
        console.log('WebSocket disconnected:', event);
        if (this.reconnectAttempts < this.maxReconnectAttempts) {
          console.log(`Attempting to reconnect (${++this.reconnectAttempts}/${this.maxReconnectAttempts})`);
          setTimeout(() => this.connect(userId), this.reconnectInterval);
        } else {
          console.error('Max reconnection attempts reached');
        }

        // 触发关闭监听器
        if (this.listeners.has('close')) {
          this.listeners.get('close')?.forEach(callback => callback(event));
        }
      };

      this.ws.onerror = (error) => {
        console.error('WebSocket error:', error);

        // 触发错误监听器
        if (this.listeners.has('error')) {
          this.listeners.get('error')?.forEach(callback => callback(error));
        }
      };
    } catch (error) {
      console.error('Failed to create WebSocket connection:', error);
    }
  }

  send(message: string) {
    if (this.ws && this.ws.readyState === WebSocket.OPEN) {
      this.ws.send(message);
    } else {
      console.warn('WebSocket is not open. ReadyState:', this.ws?.readyState);
    }
  }

  disconnect() {
    if (this.ws) {
      this.ws.close();
      this.ws = null;
    }
  }

  isConnected(): boolean {
    return this.ws !== null && this.ws.readyState === WebSocket.OPEN;
  }

  addEventListener(type: string, callback: (data: any) => void) {
    if (!this.listeners.has(type)) {
      this.listeners.set(type, new Set());
    }
    this.listeners.get(type)?.add(callback);
  }

  removeEventListener(type: string, callback: (data: any) => void) {
    if (this.listeners.has(type)) {
      this.listeners.get(type)?.delete(callback);
    }
  }

  private notifyListeners(type: string, data: any) {
    if (this.listeners.has(type)) {
      this.listeners.get(type)?.forEach(callback => callback(data));
    }
  }

  getStatus() {
    if (!this.ws) return 'disconnected';
    const readyStates = ['CONNECTING', 'OPEN', 'CLOSING', 'CLOSED'];
    return readyStates[this.ws.readyState];
  }
}

// 创建全局单例
const websocketService = new WebSocketService();

export default websocketService;

// React Hook for easy integration
export const useWebSocket = ({ onMessage, onOpen, onClose, onError }: WebSocketServiceProps) => {
  const wsRef = useRef(websocketService);

  useEffect(() => {
    if (onMessage) {
      wsRef.current.addEventListener('message', onMessage);
    }
    if (onOpen) {
      wsRef.current.addEventListener('open', onOpen);
    }
    if (onClose) {
      wsRef.current.addEventListener('close', onClose);
    }
    if (onError) {
      wsRef.current.addEventListener('error', onError);
    }

    // 清理函数
    return () => {
      if (onMessage) {
        wsRef.current.removeEventListener('message', onMessage);
      }
      if (onOpen) {
        wsRef.current.removeEventListener('open', onOpen);
      }
      if (onClose) {
        wsRef.current.removeEventListener('close', onClose);
      }
      if (onError) {
        wsRef.current.removeEventListener('error', onError);
      }
    };
  }, [onMessage, onOpen, onClose, onError]);

  return wsRef.current;
};
